import React from "react";
import {profile} from "./img/export";

class AboutMe extends React.Component{
    constructor(props) {
        super(props);
    }
    render() {
        return(
          <div className='flex pa4 ma4'>
              <img alt='profile' src={profile}/>
              <p>im Idan Bunimovich Completed successfully second year of computer science major at the Interdisciplinary Center Herzliya (“IDC”).
              i was a DRONE OPERATOR AND INSTRUCTOR- IDF  							                                  2013 – 2016
                  •	Conducting drone instruction and presentations in multi participant forums and expos.
                  •	Operating  Skylark Drone in complex army operations.
              </p>
          </div>
        );
    }
}
export default AboutMe;
